//处理方法
$.dmsindex = {
    load: function () {
        $("#mainContent").height($(window).height() - 128);
      
        $(window).resize(function (e) {
            $("#mainContent").height($(window).height() - 128);
            $.dmsindex.loadMenu(true);
        });

        $(window).load(function () {
            window.setTimeout(function () {
                $('#ajax-loader').fadeOut();
                Loading(false);
            }, 300);
        });
        $.dmsindex.loadMenu(true);
        //$.dmstab.init();
    },
    jsonWhere: function (data, action) {
        if (action == null) return;
        var reval = new Array();
        $(data).each(function (i, v) {
            if (action(v)) {
                reval.push(v);
            }
        })
        return reval;
    },
    loadMenu: function (isInit) {
        var data = authorizeMenuData;//获取查询对象        
        var _html = "";
        $.each(data, function (i) {
            var row = data[i];
            if (row.ParentId == "0") {
                if (i == 0) {
                    _html += '<li class="dropdown-submenu one active">';
                } else {
                    _html += '<li class="dropdown-submenu one">';
                }
                var childNodes = $.dmsindex.jsonWhere(data, function (v) { return v.ParentId == row.ModuleId });
                if (childNodes.length > 0) {
                    _html += '<a class="" data-id="" href="javascript:void(0)">'
                    _html += '<i class="' + row.Icon + ' icon-xlarge"></i><span class="nav-label">' + row.FullName + '</span><span class="fa arrow"></span>'
                    _html += '</a>'

                } else {
                    _html += '<a class="menuItem" data-id="' + row.ModuleId + '" href="javascript:void(0)">'
                    _html += '<i class="' + row.Icon + ' icon-xlarge"></i><span class="nav-label">' + row.FullName + '</span>'
                    _html += '</a>'
                    navJson[row.ModuleId] = row;

                }
                if (childNodes.length > 0) {
                    _html += '<ul class="dropdown-menu">';
                    $.each(childNodes, function (i) {
                        var subrow = childNodes[i];
                        var subchildNodes = $.dmsindex.jsonWhere(data, function (v) { return v.ParentId == subrow.ModuleId });
                        _html += '<li class="dropdown-submenu">';
                        if (subchildNodes.length > 0) {
                            _html += '<a href="#"><i class="' + subrow.Icon + ' "></i>' + subrow.FullName + '';
                            _html += '<span class="fa fa-caret-right" style="float:right;margin-top:5px;"></span>';
                            _html += '</a>';
                            _html += '<ul class="dropdown-menu">';
                            $.each(subchildNodes, function (i) {
                                var subchildNodesrow = subchildNodes[i];
                                _html += '<li class="dropdown-submenu"><a class="menuItem" data-id="' + subchildNodesrow.ModuleId + '" href="javascript:void(0)"><i class="' + subchildNodesrow.Icon + '"></i>' + subchildNodesrow.FullName + '</a></li>';

                                navJson[subchildNodesrow.ModuleId] = subchildNodesrow;
                            });
                            _html += '</ul>';

                        } else {
                            _html += '<a class="menuItem" data-id="' + subrow.ModuleId + '" href="javascript:void(0)"><i class="' + subrow.Icon + ' "></i>' + subrow.FullName + '</a>';

                            navJson[subrow.ModuleId] = subrow;
                        }
                        _html += '</li>';
                    });
                    _html += '</ul>';
                }
                _html += '</li>'
            }
        });
        $("#side-menu").empty().html(_html);
        //点击打开功能页面
        $("#side-menu li a[class='menuItem']").bind("click", function () {
            //添加移除样式
            var $this = $(this).parent();
            $this.siblings().removeClass("active");
            $this.addClass("active");
            //处理父级
            var $parent = $this.parents("li");
            $parent.siblings().removeClass("active");
            $parent.addClass("active");
            //获取当前选择
            var id = $(this).attr("data-id");
            var data = navJson[id];           
            if (data) {
                //处理内容
                $("#modelTitle").html('<i class="' + data.Icon + '"></i>' + data.FullName);
                $("#DMS_iframe").attr("src", contentPath + data.UrlAddress);
            }
        })

    },
    //退出系统
    indexOut: function () {
        dialogConfirm("注：您确定要退出本次登录吗？", function (r) {
            if (r) {
                Loading(true, "正在安全退出...");
                window.setTimeout(function () {
                    $.ajax({
                        url: contentPath + "/Login/OutLogin",
                        type: "post",
                        dataType: "json",
                        success: function (data) {
                            window.location.href = contentPath + "/Login/Default";
                        }
                    });
                }, 500);
            }
        });
    }
}

function NavFrame(data)
{
    //data={Icon:,FullName:,Url:}
    $("#modelTitle").html('<i class="' + data.Icon + '"></i>' + data.FullName);
    $("#DMS_iframe").attr("src", contentPath + data.Url);
}
//共子页面调用方法
function OpenNav(id, para) {
    if (id) {
        if (tablist != null && navJson != null) {
            var data = navJson[id];
            if (para) {

                var parajson = JSON.stringify(para);
                parajson = encodeURIComponent(parajson);
                tablist.newTab({ id: id, title: data.FullName, closed: true, icon: data.Icon, url: contentPath + data.UrlAddress + "?queryjson=" + parajson + "" });
                //queryJson: JSON.stringify(queryJson)
            } else {

                tablist.newTab({ id: id, title: data.FullName, closed: true, icon: data.Icon, url: contentPath + data.UrlAddress });
            }
        }
    } else {
        alert("无效菜单项编号");
    }

}